TEENS LIKE IT BIG - Amy Brooke - Ho in the Hostel

James Deen has had enough. In all his years of owning his hostel, not once has he met anyone like Amy. She smokes, drinks, fucks, and plays loud music all day. When he kindly asks her to turn down the music, she sends him packing. That's ok, he'll find a way to get back at her...
